import { useEffect, useState } from "react";
import { ICategoryName } from '../Interfaces'
import axios from "axios";





function AddEditTransaction() {

    const [categories, setCategories] = useState<ICategoryName[]>();
    const [category, setCategory] = useState<string>('');
    const [description, setDescription] = useState<string>('');
    const [month, setMonth] = useState<string>('');
    const [incOrExp, setincOrExp] = useState<string>('');
    const [amount, setAmount] = useState<number>(0);


    useEffect(() => {
        const url = 'http://localhost:8080/api/categories';
        axios.get(url).then((response) => {
            setCategories(response.data);
            console.log({categories});
        });
    }, []);


    return (
        <div>
            <h1>ADD NEW</h1>
            <form>
                <label >Type</label>
                <select value={incOrExp}>
                    <option value="Income">Income</option>
                    <option value="Expense">Expense</option>
                </select>
                <label >Category</label>
                <select id="country" name="">
                    {categories
                    ? categories.map((category) => {
                        return <option key={category.categoryName} value={category.categoryName}>{category.categoryName}</option>;
                    }): null}
                </select>

                <label >Month</label>
                <select name="">
                    <option value="January">January</option>
                    <option value="canada">February</option>
                    <option value="usa">March</option>

                    <option value="australia">April</option>
                    <option value="canada">May</option>
                    <option value="usa">June</option>

                    <option value="australia">July</option>
                    <option value="canada">August</option>
                    <option value="usa">September</option>

                    <option value="australia">October</option>
                    <option value="canada">November</option>
                    <option value="usa">December</option>
                </select>

                <label >Description</label>
                <textarea name="subject" placeholder="Add description.." ></textarea>

                <label >Amount</label>
                <input type="number" step="0.01" id="fname" name="firstname" placeholder="Amount..." />







            </form>


        </div>

    );
}

export default AddEditTransaction;
